import Table from './pages/Table';
import StudentDetail from './pages/StudentDetail';
import Forms from './pages/Forms';
import "./App.css";
import { Route,Routes } from 'react-router-dom';
import { Form, Button, Checkbox, DatePicker, Input, Select, Space } from "antd";
import ListTopics from './components/ListTopics/ListTopics';
import Login from './components/Login/Login';
import NewTopic from './components/NewTopic/NewTopic';
import ReplyTopic from './components/ReplyTopic/ReplyTopic';
import ShowTopics from './components/ShowTopics/ShowTopics';


function App() {
  return (

      <Routes>
          <Route path='/' element={<Table/>}/>
          <Route path='/detail/:studentId' element={<StudentDetail/>}/>
          <Route path='/forms' element={<Forms/>}/>
          <Route path='/ListTopics' element={<ListTopics/>}/>
          <Route path='/Login' element={<Login/>}/>
          <Route path='/NewTopic' element={<NewTopic/>}/>
          <Route path='/ReplyTopic' element={<ReplyTopic/>}/>
          <Route path='/ShowTopics' element={<ShowTopics/>}/>

      </Routes>


  );
}

export default App;
